import React from 'react';
import { Link } from 'react-router-dom';

function SignupPage() {
  return (
    <div>
      <h1>Signup Page</h1>
      <p>Already have an account? <Link to="/">Login</Link></p>
    </div>
  );
}

export default SignupPage;
